using eLogo.PdfService.Services.Interfaces;
using NAFCore.Diagnostics.Model;
using System;
using System.Linq;

namespace eLogo.PdfService.Api.Diagnostics
{
    public class IronPdfDiagnoseService : Diagnosis
    {
        private readonly IIronPdfConverter _pdfConverterService;
        public IronPdfDiagnoseService(IIronPdfConverter pdfConverterService)
        {
            this._pdfConverterService = pdfConverterService;
        }

        public override DiagnosticResult PerformDiagnosis()
        {
            try
            {
                var result = _pdfConverterService.ConvertHtmlToPdf(new Models.HtmlToPdfModelBinary()
                {
                    Content = Convert.FromBase64String(""),
                    CorrelationId = Guid.NewGuid().ToString(),
                    Margins = 10,
                    PageOrientation = "Portrait",
                    PdfConverter = 20,
                    PageSize = "A4",
                }).Result;

                if (result.Success)
                    return new DiagnosticResult("IronPdf Diagnose Result", true)
                    {
                        State = NAFCore.Diagnostics.Model.Enums.DiagnosticStateEnum.SUCCESS,
                        Name = "IronPdf Result",
                        Parameters = new System.Collections.Generic.List<DiagnosticParameter>() {
                            new DiagnosticParameter(){ Name="CollerationID", Value=result.Id},
                            new DiagnosticParameter(){ Name="Message", Value=result.Message },
                            new DiagnosticParameter(){ Name="Result Length", Value=result.Content.Length.ToString() }
                        }
                    };

                return new DiagnosticResult("IronPdf Diagnose Result", true) { State = NAFCore.Diagnostics.Model.Enums.DiagnosticStateEnum.FAIL };
            }
            catch (Exception ex)
            {
                return new DiagnosticResult("IronPdf Diagnose Result", true)
                {
                    State = NAFCore.Diagnostics.Model.Enums.DiagnosticStateEnum.FAIL,
                    Exception = new DiagnosticException() { Message = ex.Message, Stack = new[] { ex.StackTrace }.ToList() },
                    Name = "Iron PDf Converter",
                };

            }
        }
    }
}
